import React, { Component } from 'react';

export default class Temp extends Component {
    constructor(props){
        super(props);
        this.state = {
            pdList: []
        }
    }
    componentDidMount(){
        fetch('/api/products')
        .then((res) => {
            res.json().then((data) => {
                this.setState({
                    pdList: data
                })
            })
        })

        console.log(this.state.pdList);
    }

    render(){
        return(
            <div>
                {this.state.pdList.map((el) => {
                    return (
                        <div>
                        {el.id}
                        </div>
                    )
                })}
            </div>
        )
    }
}
